import React from "react";
import Table from "./Table";

const Info = ({
  avgPPG,
  avgRPG,
  avgAPG,
  avgTO,
  totPPG,
  totRPG,
  totAPG,
  totTO,
  avgFG,
  avgThree,
  avgFree,
  grade,
}) => {
  return (
    <div className="info">
      <div className="left">
        <Table
          avgPPG={avgPPG}
          avgRPG={avgRPG}
          avgAPG={avgAPG}
          avgTO={avgTO}
          totPPG={totPPG}
          totRPG={totRPG}
          totAPG={totAPG}
          totTO={totTO}
          avgFG={avgFG}
          avgThree={avgThree}
          avgFree={avgFree}
        />
      </div>
      <div className="right">
        <h1 className="grade">A+</h1>
      </div>
    </div>
  );
};

export default Info;
